import React, { useContext, useEffect } from "react";
import ProductItems from "./ProductItem/ProductItems";
import classes from "./AvailableItems.module.css";
import axios from "axios";
import CartContext from "../../Store/cart-context";


const AvailableItems = (props) => {
  const cartCtx = useContext(CartContext);

  const productsArr = [
    {
      id: "1",
  
      title: "GTA 6",
  
      price: 5500,
      
  
      imageUrl: "https://i.redd.it/tg2w4gku88o61.png",
    },
  
    {
      id: "2",
  
      title: "ASSAIAN'S CREED",
  
      price: 3500,
  
      imageUrl: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTCr_v-j5TRFyWVQW-0yPTH-JkFWpi3q6RkMg&usqp=CAU",
    },
  
    {
      id: "3",
  
      title: "NFS MW",
  
      price: 2400,
  
      imageUrl: "data:image/jpeg;base64,",
    },
  
    {
      id: "4",
  
      title: "FAR CRY 7",
  
      price: 1900,
  
      imageUrl: "data:image/jpeg;base64,",
    },
  ];

  let emailId = localStorage.getItem("email").replace(".", "").replace("@", "");
  

  useEffect(() => {
    axios
      .get(
        `https://crudcrud.com/api/b6bd1f08150c4afeba4ab87587812ef2/cart${emailId}`
      )
      .then((res) => {
        cartCtx.initilizeCart(res.data);
      });
  }, []);
  
  return (
    <div className={classes.content}>
     
      <ul className={classes.ul}>
        {productsArr.map((item) => {
          return (
            <ProductItems
            key={Math.random()}
            id={item.id}
            title={item.title}
            price={item.price}
            image={item.imageUrl}
            quantity={1}
            _id={item._id}
            />
          );
        })}
      </ul>
    </div>
  );
};

export default AvailableItems;
